import React from 'react';
import {Jumbotron} from 'react-bootstrap';
import {PageHeader} from 'react-bootstrap';

const Home = () => {
    return (
        <div>
            <Jumbotron>
                <div>Hello, World</div>
                <PageHeader>
                    <div>hello</div>
                </PageHeader>
            </Jumbotron>
        </div>
    )
}

export default Home;
